import Header from './components/Header';
import Navbar from './components/Navbar';
import Details from './components/Details';

function App() {
  return (
    <div className="flex relative">
      <Navbar />
      <div className="flex-1">
        <Details />
      </div>
      <Header className="fixed inset-x-0 z-10" />
    </div>
  );
}


export default App;
